import React from 'react';
import classes from './RunService.module.scss';

const RunService = (props) => {
    return (
        <div>
        <input type="text" onChange={props.onChange} name="serviceJobID" placeholder="uint256 jobID"></input>
        <input type="text" onChange={props.onChange} name="port" placeholder="uint256 port"></input>
        <input type="text" onChange={props.onChange} name="serviceDapps" placeholder="uint256 dapps"></input>
            <button onClick={props.runService}>Run Service</button>
        </div>
    );
};

export default RunService;
